#include <iostream>
#include <vector>

using namespace std;

/*
    return val means the begin pos of haystack
    -1 means no matching substring
*/
int KMP(char *haystack, char *needle) {
    // pre-process
    if(haystack[0] == 0 && needle[0] == 0)
        return 0;

    int i, j, k, min, cur;

    //construct F(t) in vector len
    vector<int > len;
    len.push_back(0);
    for(i=1; needle[i] != 0; i++){
        if(len[i-1] == 0){
            if(needle[i] == needle[0])
                len.push_back(1);
            else
                len.push_back(0);
        }else{
            if(needle[i] == needle[len[i-1]])
                len.push_back(len[i-1]+1);
            else
                len.push_back(0);
        }
    }
    // KMP finder
    j = 0;
    for(i=0; haystack[i] != 0; ) {
        // matching
        for(; needle[j] != 0; j++) {
            if(haystack[i+j] != needle[j])
                break;
        }
        //finded
        if(needle[j] == 0)
            return i;
        else{ // jump
            if(j){
                cur = j - len[j-1];
                i += cur;
                j = len[j-1];
            }else{
                j = 0;
                i++;
            }
        }
    }
    //match failed
    return -1;
}

int main() {

    char *haystack = "abcabdabcdacabcdabdads";
    char *needle = "abcdabd";
/*
    char *haystack = "aaaaaaaaaafaaaaaaaaaaaaaaaab";
    char *needle = "aaaaab";

    char *haystack = "";
    char *needle   = "";
*/
    cout << KMP(haystack, needle)<<endl;
}
